import React, { useState } from 'react';
import 'react-native-gesture-handler';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button} from 'react-native';

export default function App() {
  const [questionNum, setQuestion] = useState(0);
  const nextQuestion = () => {
    setQuestion(questionNum+1);
  }
  return (
    <View style={styles.container}>
      <Text>Question { questionNum }</Text>
      <Text> I feel totally comfortable in my understanding of: • What employers want in an employee • The tools I need to conduct an effective job search • Goal setting and am able to set effective goals • Setting a schedule for my daily tasks during job search • How to dress appropriately for the job search</Text>
      <View style = {styles.buttonContainer}>
        <Button title = "Next" />
      </View>
      <View style={[{ width: "20%", margin: 10, backgroundColor: "#004473" }]}>
          <Button
            //onPress={}
            title="Strongly Agree"
            accessibilityLabel="Next Question"
          />
      </View>
      <View style={[{ width: "20%", margin: 10, backgroundColor: "#004473" }]}>
          <Button
            //onPress={}
            title="Agree"
            accessibilityLabel="Next Question"
          />
      </View>
      <View style={[{ width: "20%", margin: 10, backgroundColor: "#004473" }]}>
          <Button
            //onPress={}
            title="Disagree"
            accessibilityLabel="Next Question"
          />
      </View>
      <View style={[{ width: "20%", margin: 10, backgroundColor: "#004473" }]}>
          <Button
            //onPress={}
            title="Strongly Disagree"
            accessibilityLabel="Next Question"
          />
      </View>
      <View style={[{ width: "20%", margin: 50, backgroundColor: "#004473" }]}>
                <Button
                  onPress={nextQuestion}
                  title="Next"
                  accessibilityLabel="Next Question"
                />
            </View>
      <StatusBar style="auto" />
    </View>
  );
}
